import React from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Card,
  CardContent,
  Container,
  CssBaseline,
  Grid,
  Link,
  ThemeProvider,
  createTheme,
  Box,
} from '@mui/material';
import SportsSoccerIcon from '@mui/icons-material/SportsSoccer';
import SportsEsportsIcon from '@mui/icons-material/SportsEsports';
import SportsTennisIcon from '@mui/icons-material/SportsTennis';
import GamesIcon from '@mui/icons-material/Games';
import PuzzleIcon from '@mui/icons-material/Extension';
import CasinoIcon from '@mui/icons-material/Casino';
import BrainIcon from '@mui/icons-material/Memory';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#000',
      paper: '#121212',
    },
    text: {
      primary: '#fff',
      secondary: '#b0bec5',
    },
  },
  typography: {
    h1: {
      fontSize: '3rem',
      fontWeight: 700,
      color: '#fff',
    },
    h5: {
      fontSize: '1.5rem',
      fontWeight: 400,
      color: '#fff',
    },
    body1: {
      fontSize: '1rem',
      color: '#b0bec5',
    },
    body2: {
      fontSize: '0.875rem',
      color: '#b0bec5',
    },
  },
});

const categories = [
  {
    icon: <SportsEsportsIcon />,
    title: 'Fantasy game',
    games: ['Fantasy cricket', 'Fantasy football', 'Fantasy basketball'],
  },
  {
    icon: <SportsTennisIcon />,
    title: 'Sports Games',
    games: ['Archery', 'Cricket 100X'],
  },
  {
    icon: <GamesIcon />,
    title: 'Arcade Games',
    games: ['Fruit Chop', 'Fruit Dart'],
  },
  {
    icon: <PuzzleIcon />,
    title: 'Puzzle Games',
    games: ['Bubble Shooter', 'Block Puzzle'],
  },
  {
    icon: <CasinoIcon />,
    title: 'Card Games',
    games: ['All Card Games', 'Rummy', 'Poker', 'Call Break', 'Win Patti'],
  },
  {
    icon: <GamesIcon />,
    title: 'Casual Games',
    games: [
      'Ludo',
      'Snakes and Ladders',
      'Carrom',
      'Pool',
      'Runner No.1',
      'Opinio',
      'Crash Skill',
    ],
  },
  {
    icon: <BrainIcon />,
    title: 'Brain Games',
    games: ['Speed Chess'],
  },
];

export default function Dashboard() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="fixed">
        <Toolbar>
          <SportsSoccerIcon sx={{ mr: 2 }} />
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Sports Tournament Dashboard
          </Typography>
          <Link href="#" color="inherit" underline="none">
            <Typography variant="body1" color="inherit">Logout</Typography>
          </Link>
        </Toolbar>
      </AppBar>
      <Toolbar />
      <Container sx={{ mt: 4 }}>
        <Typography variant="h4" gutterBottom>
          Offline Games
        </Typography>
        <Grid container spacing={2}>
          {categories.map((category, index) => (
            <Grid item xs={12} md={6} lg={4} key={index}>
              <Card sx={{ height: '100%' }}>
                <CardContent>
                  <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                    {category.icon}
                    <Typography variant="h5" component="div" sx={{ ml: 2 }}>
                      {category.title}
                    </Typography>
                  </Box>
                  {category.games.map((game, idx) => (
                    <Typography variant="body1" key={idx} sx={{ ml: 4 }}>
                      {game}
                    </Typography>
                  ))}
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </ThemeProvider>
  );
}
